            table[data-sortable].sortable-theme-bootstrap {
                font-family: gotham;
                font-size: 12px;
                width: 100%;
                line-height: inherit;
            }
            table[data-sortable] th, table[data-sortable] td {

                padding: 0.4em;

            table[data-sortable] th[data-sorted-direction="descending"]:after {

        <script>
            // sortable: http://github.hubspot.com/sortable
            var Table = Webviews.data();

            $(function() {
                var $table = $('table'),
                    $tbody = $('tbody', $table);

                $(document.body).perfectScrollbar();

                Table.bind(function(data) {
                    var lines = (data || '').split('\n');

                    $('thead', $table).empty().append('<tr>'+lines.shift().split(',').map(function(column) {
                        return '<th>'+column+'</th>';
                    })+'</tr>');

                    $tbody.empty();
                    lines.forEach(function(line) {
                        $tbody.append('<tr>'+line.split(',').map(function(column) {
                            return '<td>'+column+'</td>';
                        })+'</tr>');
                    });

                    $table.removeAttr('data-sortable-initialized');
                    data ? Sortable.initTable($table.show()[0]) : $table.hide();
                });
            });
        </script>
    </head>
    <body>
        <table data-sortable class="sortable-theme-bootstrap">
            <thead></thead>
            <tbody></tbody>
        </table>
    </body>
</html>
